    public static void heapify(int[] nums, int n, int root){
        int left = 2*root + 1;
        int right = 2*root + 2;
        int largest = root;
        if(left  nums[largest]) largest = left;
        if(right  nums[largest]) largest = right;

        if(largest != root){
            int temp = nums[root];
            nums[root] = nums[largest];
            nums[largest] = temp;

            heapify(nums, n, largest);
        }
    }

    public static void heapSort(int[] nums){
        int n=nums.length;
        for(int i=n/2-1; i>=0; i--){
            heapify(nums,n,i);
        }

        for(int i=n-1; i>0; i--){
            int temp = nums[0];
            nums[0] = nums[i];
            nums[i] = temp;
            heapify(nums, i, 0);
        }
    }


}

