package com.company;

import java.util.HashMap;

public class DJS {
    private HashMap parent = new HashMap<>();
    public DJS(int[] inputs){
        for(int i:inputs)
            parent.put(i,i);
    }
    public int Find(int curr){
        if(parent.get(curr) == curr) return curr;
        return Find(parent.get(curr));
    }
    public void Union(int ch, int pa){
        int x = parent.get(ch);
        int y = parent.get(pa);
        parent.put(x, y);
    }
}

