class Solution {
    public boolean isSymmetric(TreeNode root) {
        Queue queue = new LinkedList();
        queue.offer(root);
        queue.offer(root);
        while(!queue.isEmpty()){
            TreeNode u = queue.poll();
            TreeNode v = queue.poll();
            if(u == null && v == null) continue;
            if((u == null || v == null) || (u.val != v.val)) return false;
            queue.offer(u.left);
            queue.offer(v.right);
            queue.offer(u.right);
            queue.offer(v.left);
        }
        return true;
    }

