                    s_skp++;
                    s_index--;
                }
                else if(s_skp > 0){
                    s_skp--;
                    s_index--;
                }else{
                    break;
                }
            }
            while(t_index >= 0){
                if(t.charAt(t_index) == '#'){
                    t_skp++;
                    t_index--;
                }
                else if(t_skp > 0){
                    t_skp--;
                    t_index--;
                }
                else{
                    break;
                }
            }
            if(s_index >= 0 && t_index >= 0){
                if(s.charAt(s_index) != t.charAt(t_index)){
                    return false;
                }
            }
            else{
                if(s_index >= 0 || t_index >= 0){
